                new Movie { MovieId = 3, Title = "Scooby-Doo", ReleaseYear = 2002, Runtime = 89, Poster = "32bzh3HnRZdE8oM9pwfmGJUYnvl.jpg", VoteAverage = 6, VoteCount = 3580, Favorite = false, Overview = "Deux ans après s'être résolus à fermer la Mystère & Cie, le super-chien Scooby-Doo et ses amis Fred, Daphné, Sammy et Véra se retrouvent sur Spooky Island. Les cinq limiers au flair inimitable ont été appelés sur place après une cascade d'incidents paranormaux dans l'immense parc d'attractions de Spring Break.L'excentrique Emile Mondavarious, le maître de l'île, craint que le site ne soit réellement hanté, et compte sur la joyeuse bande pour résoudre au plus vite ces troublantes énigmes et mettre un terme à la fuite de sa richissime clientèle.Oubliant leurs petits désaccords, les cinq acceptent avec enthousiasme cette périlleuse mission. Faux esprits, monstres bidons, effets spéciaux... Scooby-Doo et ses copains croyaient avoir tout vu. Mais à Spooky Island, ils ne sont pas au bout de leurs surprises." },
