                new Movie { MovieId = 6, Title = "The Legend of Zorro", ReleaseYear = 2005, Runtime = 129, Poster = "hjWcpt9GI9v9NSkex58GUZhlS25.jpg", VoteAverage = 6.1, VoteCount = 2428, Favorite = false, Overview = "" },
                new Movie { MovieId = 7, Title = "Le code Da Vinci", ReleaseYear = 2006, Runtime = 149, Poster = "q6wt3HwGwRnzKbpgwNTeIZgHKkH.jpg", VoteAverage = 6.7, VoteCount = 7861, Favorite = false, Overview = "Lorsque le conservateur en chef du musée du Louvre Jacques Saunière est assassiné, le commissaire Bezu Fache fait appel au professeur de symbologie de Harvard Robert Langdon, de passage à Paris, afin qu'il déchiffre le message crypté rédigé par la victime juste avant sa mort. Or, à première vue, ce code porte à croire que Langdon serait le tueur recherché. Débarque Sophie Neveu, cryptologue pour la police de Paris et petite-fille de Saunière. Sentant que Langdon est pris au piège, la jeune femme organise sa fuite et l'entraîne dans une course de 36 heures entre la France, l'Angleterre et l'Écosse, au cours de laquelle ils seront amenés à découvrir la mission secrète du Prieuré de Sion, dont Saunière était le Grand Maître, ainsi que la véritable nature du Saint-Graal." },
