                new Movie { MovieId = 9, Title = "Fracture", ReleaseYear = 2007, Runtime = 113, Poster = "svCEllDaXbt3eNlbf4HZLA5kKjJ.jpg", VoteAverage = 7.3, VoteCount = 3220, Favorite = false, Overview = "" },
                new Movie { MovieId = 10, Title = "Spider-Man 3", ReleaseYear = 2007, Runtime = 139, Poster = "4SBTOPWMM3My5nDIlpNHt6dg78d.jpg", VoteAverage = 6.4, VoteCount = 11667, Favorite = false, Overview = "Peter Parker a la grosse tête. Ses victoires antérieures ont fait de son alter ego Spider-Man un héros admiré de tous. Son spectaculaire sauvetage de la fille du chef de police de la ville confirme son statut d’icône. Parallèlement toutefois, Mary-Jane traverse une mauvaise passe, ce que le jeune Peter, aveuglé par l’amour, manque de constater. Contrairement à son ami le milliardaire Harry Osborn, occasionnellement possédé par l’esprit de son défunt père, le Green Goblin. Tandis qu’un nouveau péril menace la ville en la personne de l’Homme de sable, une créature visqueuse s’empare de l’esprit de Peter et y injecte le goût de la vengeance. La mutation est si profonde que la conduite de l’homme-araignée, désormais gainé de noir, inquiète." },
                new Movie { MovieId = 11, Title = "L'Incroyable Hulk", ReleaseYear = 2008, Runtime = 113, Poster = "7zEWoMDAgvgHlv1D11vF3Br3ZTd.jpg", VoteAverage = 6.2, VoteCount = 9826, Favorite = false, Overview = "Le scientifique Bruce Banner vit dans l'ombre, toujours amoureux de la belle Betty Ross, et parcourt la planète à la recherche d'un antidote pour guérir le mal dont il est atteint. Les politiciens qui rêvent d'utiliser ses pouvoirs ne le laissent pas tranquille.De retour à la civilisation, notre brillant docteur est poursuivi par l'Abomination, un monstre démoniaque fait d'adrénaline et d'agressivité et dont les pouvoirs concordent avec ceux de Hulk. Une lutte digne des plus grandes bandes dessinées éclate lorsque Banner doit faire appel à Hulk pour sauver New York de la destruction totale." },
                new Movie { MovieId = 12, Title = "L'Oeil du mal", ReleaseYear = 2008, Runtime = 118, Poster = "lLbElXAzCNxaCaHGBDvLv7KM9QM.jpg", VoteAverage = 6.4, VoteCount = 2367, Favorite = false, Overview = "" },
