                new Movie { MovieId = 14, Title = "State of Play", ReleaseYear = 2009, Runtime = 127, Poster = "cAFfhia4joDvGK2zvL6lOue6Xlx.jpg", VoteAverage = 6.8, VoteCount = 1554, Favorite = false, Overview = "" },
                new Movie { MovieId = 15, Title = "Anges & Démons", ReleaseYear = 2009, Runtime = 138, Poster = "zS0B5iu68dyBNXUoSpZmIaxh2ua.jpg", VoteAverage = 6.7, VoteCount = 5817, Favorite = false, Overview = "Une antique confrérie secrète parmi les plus puissantes de l'Histoire, les \"Illuminati\", qui s'était jurée autrefois d'anéantir l'Église catholique, est de retour. Cette fois, elle est sur le point de parvenir à son but : Robert Langdon, expert en religions d'Harvard, en a la certitude. Langdon a peu de temps pour comprendre ce qui se trame contre le Vatican et déjouer ces nouveaux crimes. Une course contre la montre et contre les tueurs qui démarre tel un jeu de piste : des églises romaines aux cryptes enfouies, des catacombes les plus profondes aux majestueuses cathédrales... Pour l'aider à comprendre toutes ces énigmes, Langdon va rencontrer Vittoria Vetra, une scientifique aussi belle que mystérieuse. Cette fois, il sait à qui il se confronte. Cette enquête diabolique est un piège, chaque secret est une clé, chaque révélation un danger..." },
                new Movie { MovieId = 16, Title = "Hors de moi", ReleaseYear = 2011, Runtime = 113, Poster = "OuABrWGUHbIAmaE0wkmNMvy1A7.jpg", VoteAverage = 6.7, VoteCount = 3207, Favorite = false, Overview = "" },
                new Movie { MovieId = 17, Title = "Sans limites", ReleaseYear = 2011, Runtime = 105, Poster = "786fsgu3U7P9icbllwpd6yfOIiD.jpg", VoteAverage = 7.2, VoteCount = 9033, Favorite = false, Overview = "Eddie Morra est un auteur raté qui habite un appartement crasseux et qui vient tout juste de vivre une séparation difficile. Il rencontre un jour son ancien beau-frère qui lui propose une solution à tous ses problèmes : une petite pilule magique qui éveille certaines parties du cerveau pour donner accès à un nombre inimaginable d'informations et ainsi rendre surdoué et puissant. Après avoir avalé l'un de ces comprimés, il rédige près du tiers de son roman. Lorsqu'il retrouve son fournisseur mort dans son appartement, il vole les cachets illicites et doit maintenant assumer les effets secondaires et gérer la colère de nombreux ennemis." },
                new Movie { MovieId = 18, Title = "Green Lantern", ReleaseYear = 2011, Runtime = 123, Poster = "7MMrRbyOts9v1YHYoc7LSrz8XnQ.jpg", VoteAverage = 5.2, VoteCount = 6208, Favorite = false, Overview = "Dans un univers aussi vaste que mystérieux, une force aussi petite que puissante est en place depuis des siècles : des protecteurs de la paix et de la justice appelés Green Lantern Corps, une confrérie de guerriers qui a juré de maintenir l’ordre intergalactique, et dont chaque membre porte un anneau lui conférant des super-pouvoirs. Mais quand un ennemi du nom de Parallax menace de rompre l’équilibre entre les forces de l’univers, leur destin et celui de la Terre repose sur leur dernière recrue, le premier humain jamais choisi : Hal Jordan.Les Green Lanterns ont un peu de respect pour les humains, qui n’ont jamais exploité les pouvoirs infinis de l’anneau auparavant. Mais Hal possède, une chose qu’aucun des autres membres n’a jamais eu : son humanité. Soutenu par son amour d’enfance, Hal doit rapidement maîtriser ses nouveaux pouvoirs et vaincre ses peur, pour prouver qu’il n’est pas que la clé pour vaincre Parallax… mais peut-être le plus grand Green Lantern de tous les temps." },
                new Movie { MovieId = 19, Title = "Johnny English renaît", ReleaseYear = 2011, Runtime = 101, Poster = "bRMdfPlHNbnpifEUIOEajxl8BcX.jpg", VoteAverage = 6.2, VoteCount = 2711, Favorite = false, Overview = "Tombé en disgrâce, l'agent secret britannique Johnny English s'est réfugié dans un monastère tibétain en rêvant de reprendre du service. Son souhait est sur le point de se réaliser lorsqu'on ses supérieurs font appel à lui pour une dangereuse mission. Le premier ministre chinois est menacé de mort et un seul homme peut faire toute la lumière sur ce complot d'envergure internationale. Au fil de son enquête, l'espion aux méthodes très peu orthodoxes découvre que la compagnie Vortex se trouve derrière cette conspiration. Pour l'arrêter, il devra mettre la main sur trois clés, ce qui obligera une taupe à se dévoiler." },
                new Movie { MovieId = 20, Title = "Sherlock Holmes: Le jeu des ombres", ReleaseYear = 2011, Runtime = 129, Poster = "kbeSPWIRkWZYQgLCyPqxjj4G0kx.jpg", VoteAverage = 7.1, VoteCount = 9009, Favorite = false, Overview = "Sherlock Holmes a toujours été le plus brillant de sa classe… jusqu'à maintenant. Car un nouvel grand esprit criminel s'est fait remarquer en Europe : le professeur Moriarty. Non seulement il est l’égal intellectuel de Holmes, mais sa capacité pour le mal, couplée à une absence totale de conscience, pourrait effectivement lui donner l'avantage face au détective de renom. Lorsque le prince héritier d'Autriche est retrouvé mort, les preuves, telle qu'interprétées par l'inspecteur Lestrade, pointe le suicide. Sauf que Sherlock Holmes en a lui déduit un assassinat… qui ne pourrait être qu'une seule pièce d'un puzzle plus vaste et de beaucoup plus mauvais augure, conçu par le professeur Moriarty." },
                new Movie { MovieId = 21, Title = "Ghost Rider: Esprit de vengeance", ReleaseYear = 2011, Runtime = 95, Poster = "i0jXQFuSsKLDNxWH7mV0BijugtY.jpg", VoteAverage = 5, VoteCount = 3148, Favorite = false, Overview = "" },
