                new Movie { MovieId = 23, Title = "Total Recall: Mémoires programmées", ReleaseYear = 2012, Runtime = 121, Poster = "sqKvTMHHbkH5ak4jPIPHCTQqb6W.jpg", VoteAverage = 6, VoteCount = 4680, Favorite = false, Overview = "Modeste ouvrier, Douglas Quaid rêve de s'évader de sa vie frustrante. L'implantation de souvenirs que propose la société Rekall lui paraît l'échappatoire idéale. S'offrir des souvenirs d'agent secret serait parfait... Mais lorsque la procédure d'implantation tourne mal, Quaid se retrouve traqué par la police. Il ne peut plus faire confiance à personne, sauf peut-être à une inconnue qui travaille pour une mystérieuse résistance clandestine. Très vite, la frontière entre l'imagination et la réalité se brouille. Qui est réellement Quaid, et quel est son destin ?" },
                new Movie { MovieId = 24, Title = "Emprise sur la ville", ReleaseYear = 2013, Runtime = 109, Poster = "hagmYjjQBR5I73YFsYMXMY2Uoj3.jpg", VoteAverage = 5.9, VoteCount = 1221, Favorite = false, Overview = "Le maire de New York demande à un ex-policier d'enquêter sur l'aventure de sa femme, mais le détective privé découvre des manigances et une campagne politiques sinistres." },
                new Movie { MovieId = 25, Title = "Parker", ReleaseYear = 2013, Runtime = 118, Poster = "n3pCxunmHrK6AWpLaAThgYiguWK.jpg", VoteAverage = 6, VoteCount = 2586, Favorite = false, Overview = "Trahi par ses complices à la suite d'un cambriolage dans une foire agricole, Parker est laissé pour mort sur le bord d'une route de campagne. Évidemment bien en vie, ce dernier entreprend de se venger dès son réveil afin de récupérer sa part du butin. Le criminel retrouvera ses anciens acolytes dans le luxueux quartier de West Palm Beach en Floride, où ces derniers se sont installés en vue du vol d'une importante collection de bijoux. Parker sera alors aidé par Leslie, une agente immobilière se remettant difficilement d'un divorce particulièrement éprouvant, qui espère bien obtenir un pourcentage des avoirs que son nouvel ami compte tirer de toute cette histoire." },
                new Movie { MovieId = 26, Title = "Insaisissable", ReleaseYear = 2013, Runtime = 115, Poster = "mskYkcgAMCOKncFMfTWAHL5sUTo.jpg", VoteAverage = 7.4, VoteCount = 13699, Favorite = false, Overview = "« Les Quatre Cavaliers », un groupe de brillants magiciens et illusionnistes, vient de donner deux spectacles de magie époustouflants: le premier en braquant une banque sur un autre continent, le deuxième en transférant la fortune d'un banquier véreux sur les comptes en banque du public. Deux agents spéciaux du FBI et d'Interpol sont déterminés à les arrêter avant qu'ils ne mettent à exécution leur promesse de réaliser des braquages encore plus audacieux. Ils font appel à Thaddeus, spécialiste reconnu pour expliquer les tours de magie les plus sophistiqués. Alors que la pression s'intensifie, et que le monde entier attend le spectaculaire tour final des Cavaliers, la course contre la montre commence.  Coproduction États-Unis/France." },
                new Movie { MovieId = 27, Title = "L'homme d'acier", ReleaseYear = 2013, Runtime = 143, Poster = "cB46TSg3kGjq2eVy5kVUhlpUa1H.jpg", VoteAverage = 6.6, VoteCount = 13155, Favorite = false, Overview = "Un petit garçon découvre qu'il possède des pouvoirs surnaturels et qu'il n'est pas né sur Terre. Plus tard, il s'engage dans un périple afin de comprendre d'où il vient et pourquoi il a été envoyé sur notre planète. Mais il devra devenir un héros s'il veut sauver le monde de la destruction totale et incarner l'espoir pour toute l'humanité." },
                new Movie { MovieId = 28, Title = "Sans arrêt", ReleaseYear = 2014, Runtime = 107, Poster = "Nkgaj3X0W2jHQ1TzHEgWFpN3kJ.jpg", VoteAverage = 6.8, VoteCount = 4586, Favorite = false, Overview = "Au cours d'un vol de routine, Bill Marks, un maréchal de l'air alcoolique et désabusé, reçoit un message anonyme d'un passager menaçant de tuer une personne se trouvant à bord de l'appareil toutes les vingt minutes, et ce, jusqu'à ce que les autorités acceptent de transférer 150 millions de dollars dans un compte bancaire. Étant le seul à prendre la menace au sérieux, Bill cherche tant bien que mal à découvrir qui se cache derrière pareille machination. L'homme de loi réalise toutefois trop tard qu'il est victime d'un coup monté, chacune de ses actions contribuant au chaos et aidant directement la cause de l'individu qu'il tente d'arrêter." },
                new Movie { MovieId = 29, Title = "Predestination", ReleaseYear = 2014, Runtime = 97, Poster = "pn0bw4DDYVarCLBbWRg1DWUkZPX.jpg", VoteAverage = 7.4, VoteCount = 5302, Favorite = false, Overview = "" },
                new Movie { MovieId = 30, Title = "Entre les tombes", ReleaseYear = 2014, Runtime = 114, Poster = "e2sct49Yw8EJsBWT3gdmAOpEY9Y.jpg", VoteAverage = 6.3, VoteCount = 2395, Favorite = false, Overview = "Maintenant détective privé, l'ancien policier Matthew Scudder se voit confier le mandat de traquer ceux qui ont assassiné la femme d’un trafiquant de drogue." },
                new Movie { MovieId = 31, Title = "Focus", ReleaseYear = 2015, Runtime = 105, Poster = "AfKm745YiKJ14yp4UfA4jowBIPi.jpg", VoteAverage = 6.9, VoteCount = 6732, Favorite = false, Overview = "Nicky rencontre Jess dans un bar un soir. Cette dernière le convainc de devenir sa stagiaire dans le crime. Ensemble, ils escroquent de nombreuses personnes et amassent une fortune colossale. Un jour, après avoir accompli un gros coup, Nicky abandonne Jess dans un taxi et lui demande de quitter la ville, ce qu'elle fait. Trois ans plus tard, à Buenos Aires, Nicky est engagé par un pilote automobile qui lui demande de vendre un faux logiciel à son compétiteur le plus féroce afin qu'il le batte sur la piste. Il est sur le point de réussir sa mission quand Jess apparaît." },
                new Movie { MovieId = 32, Title = "Dangereux 7", ReleaseYear = 2015, Runtime = 137, Poster = "wjVn1Qng8B3ySvfJr4ovuehI141.jpg", VoteAverage = 7.2, VoteCount = 9120, Favorite = false, Overview = "L'heure de la vengeance a sonné pour Deckard Shaw, qui veut réparer l'affront fait à son frère. Il s'en prend d'abord à l'agent Hobbs en le blessant sérieusement, puis à Han qui se trouve à Tokyo. Après avoir survécu à un colis piégé, Dominic et son beau-frère Brian décident de prendre les armes et de réunir leur équipe de choc. Au volant de quelques-unes des automobiles les plus puissantes de la planète, ils tentent de retrouver leur ennemi juré. Le chef d'une escouade spéciale a la solution à leur problème et il est prêt à aider Dominic à condition que ce dernier remplisse une mission extrêmement dangereuse." },
                new Movie { MovieId = 33, Title = "Insaisissable 2", ReleaseYear = 2016, Runtime = 129, Poster = "w7Q9BAqpbPHSeo6ZDYRpFGpGUxn.jpg", VoteAverage = 6.8, VoteCount = 9410, Favorite = false, Overview = "Un an après le célèbre spectacle à la Robin des bois qui leur valut les foudres du FBI et l’adulation du public, Les Quatre Cavaliers reviennent sur scène afin de dévoiler les pratiques crapuleuses d’un magnat de l’informatique. Mais l’homme derrière leur fameux acte de disparition n’est autre que Walter Mabry, un prodige de l’informatique qui les poussera à tenter un braquage impossible afin de sauver leur réputation et révéler celui qui se cache derrière le rideau depuis le tout début." },
                new Movie { MovieId = 34, Title = "Jason Bourne", ReleaseYear = 2016, Runtime = 124, Poster = "cqvNVmn25vCmBcbwSfR1KlSOBBH.jpg", VoteAverage = 6.3, VoteCount = 4924, Favorite = false, Overview = "La traque de Jason Bourne par les services secrets américains se poursuit. Des îles Canaries à Londres en passant par Las Vegas..." },
                new Movie { MovieId = 35, Title = "Inferno", ReleaseYear = 2016, Runtime = 122, Poster = "bCqD2c1nJJY6q65VGBfMItgVvGx.jpg", VoteAverage = 6, VoteCount = 5499, Favorite = false, Overview = "Le professeur Robert Langdon se réveille, amnésique, dans un hôpital de Florence. Après qu'une policière débarque dans sa chambre en tentant de l'assassiner, la docteure Sienna Brooks le prend sous son aile. Ensemble, il découvre qu'un scientifique du nom de Bertrand Zobrist a conçu une arme bactériologique afin d'éliminer plus de la moitié de la population mondiale pour, croit-il, empêcher une surpopulation qui mènerait à l'anéantissement de l'espèce humaine. Robert et Sienna se lancent alors dans une course contre la montre à travers l'Europe afin d'empêcher le virus de se répandre et que le pire se produise." },
                new Movie { MovieId = 36, Title = "iBoy", ReleaseYear = 2017, Runtime = 90, Poster = "aqwQPVosPSjfXRF6bO9Wg48ylAR.jpg", VoteAverage = 6, VoteCount = 1010, Favorite = false, Overview = "Les éclats d'un téléphone portable se logent dans le cerveau d'un adolescent qui peut ainsi contrôler les dispositifs électroniques et utiliser ce pouvoir pour se venger." },
                new Movie { MovieId = 37, Title = "Spider-man : Les retrouvailles", ReleaseYear = 2017, Runtime = 133, Poster = "77Z0g5fc1qWJ7SfHyeiHsMkYx5O.jpg", VoteAverage = 7.4, VoteCount = 18638, Favorite = false, Overview = "Emballé par son expérience avec les Avengers, le jeune Peter Parker retourne chez lui où il vit avec sa tante May, sous l’œil vigilant de son nouveau mentor Tony Stark. Peter essaie de retourner à sa routine quotidienne – distrait par le désir de prouver qu’il est plus que l’araignée sympa du quartier. Mais avec l’arrivée du crapuleux Vautour, tout ce que Peter tient à cœur sera menacé." },
                new Movie { MovieId = 38, Title = "Mon meilleur ennemi", ReleaseYear = 2017, Runtime = 118, Poster = "2oc9wS0PjiBVCnAvYqmenCQdRLO.jpg", VoteAverage = 6.9, VoteCount = 5141, Favorite = false, Overview = "Un redoutable tueur à gages est contraint de témoigner contre son ancien employeur devant la Cour internationale de justice de La Haye. Interpol est alors chargée de l’escorter jusqu’aux Pays-Bas et engage le meilleur garde du corps du métier pour mener à bien cette mission. Mais c’était sans savoir que depuis des années, les deux hommes s’opposent : les voilà désormais obligés de s’associer pour tenter de survivre aux pires épreuves… De l’Angleterre à La Haye, ils vont vivre une aventure délirante, une succession infernale de tentatives de meurtre, de courses-poursuites pour échapper à un dictateur d’Europe de l’Est prêt à tout pour les éliminer." },
                new Movie { MovieId = 39, Title = "Jumanji : Bienvenue dans la jungle", ReleaseYear = 2017, Runtime = 119, Poster = "y1zgYmxkQDvi9Tev74PYbmer2Mv.jpg", VoteAverage = 6.8, VoteCount = 11747, Favorite = false, Overview = "Spencer, Fridge, Bethany et Martha sont quatre élèves du secondaire qui n'ont absolument rien en commun. Un jour, ils se retrouvent ensemble en retenue et découvrent l'existence d'un étrange jeu vidéo, appelé Jumanji, auquel ils décident de jouer. Rapidement, les adolescents sont aspirés dans le jeu et deviennent l'avatar qu'ils ont précédemment sélectionné. Pour revenir dans le monde réel, ils devront franchir tous les niveaux et gagner la partie. Bien des embûches les attendent sur leur route et ils n'ont chacun que trois vies pour réussir." },
