                new Movie { MovieId = 41, Title = "Meurtre et mystère", ReleaseYear = 2019, Runtime = 97, Poster = "bSMSO9xupd4R4vwTPqigHn2quLN.jpg", VoteAverage = 6.2, VoteCount = 3283, Favorite = false, Overview = "Lors d'un voyage en Europe, un policier de New York et sa femme coiffeuse tentent de résoudre un meurtre déconcertant à bord du yacht d'un milliardaire." },
                new Movie { MovieId = 42, Title = "Spider-Man : Loin des siens", ReleaseYear = 2019, Runtime = 129, Poster = "zrNKUa5SBUwue39coJArNdDgQJM.jpg", VoteAverage = 7.5, VoteCount = 12643, Favorite = false, Overview = "Depuis que les Avengers ont sauvé la planète, tout est redevenu comme avant. Peter Parker a retrouvé son ancienne vie : celle d'un adolescent qui doit composer avec l'école et ses béguins amoureux. Son alter ego Spider-Man a besoin de vacances et il ne répond même pas aux appels de Nick Fury. Lors d'un séjour scolaire en Europe, il voit apparaître un monstre qui saccage tout sur son passage. Heureusement, cette entité est tenue en échec par Mysterio. Voilà un allié idéal pour Spider-Man, qui s'enfonce dans une véritable crise identitaire. Iron Man n'est plus là pour le protéger et l'univers a besoin d'un véritable superhéros." },
                new Movie { MovieId = 43, Title = "Rapides et dangereux présentent: Hobbs et Shaw", ReleaseYear = 2019, Runtime = 137, Poster = "kgajCPm5pdH2Sa3CTCyHuUmQvgT.jpg", VoteAverage = 6.9, VoteCount = 5765, Favorite = false, Overview = "Luke Hobbs est un agent fédéral qui habite Los Angeles en compagnie de sa fille. Deckard Shaw est un mercenaire britannique qui visite régulièrement sa mère en prison. Ce sont surtout deux ennemis jurés qui ne sont pas capables de se supporter. Ils n'auront pas le choix d'enterrer momentanément la hache de guerre et de travailler ensemble afin de retrouver un virus qui a été dérobé par une agente du MI6. Hattie a disparu dans la nature, après qu'un terroriste mi-humain mi-robot ait décimé son équipe. Ce dernier est prêt à tout afin de mettre la main sur cette arme capable de décimer la moitié de l'humanité." },
                new Movie { MovieId = 44, Title = "Terminator : Sombre destin", ReleaseYear = 2019, Runtime = 128, Poster = "hiHsAVw2M6j3JHUOPoqAR7X55iB.jpg", VoteAverage = 6.5, VoteCount = 4055, Favorite = false, Overview = "Dani Ramos, 21 ans, mène une vie tranquille à Mexico avec son frère et son père. Elle voit sa vie complètement bouleversée lorsqu'un Terminator (un indestructible REV 9) est envoyé du futur pour l'éliminer. Heureusement, une humaine au physique augmentée débarque au même moment pour la protéger. Les deux femmes seront aussi aidées par la redoutable Sarah Connor, qui traque les Terminator depuis des décennies. Ensemble, elles tâcheront de trouver un moyen d'éliminer le Rev-9 et ainsi protéger Dani, qui tient le sort de l'humanité entre ses mains." },
                new Movie { MovieId = 45, Title = "Sonic le hérisson", ReleaseYear = 2020, Runtime = 99, Poster = "vwuNoe7sCWxZw7Feo3iIhym5rKM.jpg", VoteAverage = 7.4, VoteCount = 8050, Favorite = false, Overview = "Pour échapper à ses ennemis, le petit Sonic est projeté dans notre monde. Il mène une existence paisible, mais solitaire pendant dix longues années jusqu'à ce que sa vie soit à nouveau menacée. Pour ne pas être capturé par le vilain docteur Robotnik, Sonic devra se rendre à San Francisco afin de récupérer les anneaux qui lui permettront de se sauver dans une nouvelle dimension. L'agent de police Tom Wachowski, que Sonic observe dans l'ombre depuis des années, l'accompagnera dans son périple. Les deux nouveaux amis vivront bien des aventures sur la route les menant jusqu'en Californie." },
